import React, { Component } from "react";
import Maintable from "../common/maintable";
import SidePanel from "../common/sidepanel";
import { getWorshippers } from "../common/fakeWorshippers";
import { getService } from "../common/fakeServices";

class Dashboard extends Component {
  state = { services: getService(), worshippers: getWorshippers() };
  // handleServicesSelect = (service) => {
  //   this.setState({ selectedService: service });
  // };
  render() {
    return (
      <React.Fragment>
        <main className="container">
          <div>
            <h2>DashBoard</h2>
            <p>Showing number of bookings</p>
            <div className="container">
              <div className="row">
                <div className="col-m m-2">
                  <SidePanel
                    items={this.state.services}
                    selectedItem={this.state.selectedService}
                    onItemSelect={this.handleServicesSelect()}
                  />
                </div>
                <div className="col-m">
                  <Maintable items={this.state.worshippers} />
                </div>
              </div>
            </div>
          </div>
        </main>
      </React.Fragment>
    );
  }
}

export default Dashboard;
